```csharp
using System;
using System.Collections.Generic;

class Program
{
    static void Main()
    {
        List<int[]> intervals = new List<int[]>
        {
            new int[] {2, 5},
            new int[] {4, 5},
            new int[] {3, 7}
        };

        var intersection = FindIntersection(intervals);

        if (intersection != null)
        {
            Console.WriteLine($"The intersection point is: {intersection[0]}");
        }
        else
        {
            Console.WriteLine("There is no common intersection point.");
        }
    }

    static int[] FindIntersection(List<int[]> intervals)
    {
        intervals.Sort((x, y) => x[0].CompareTo(y[0]));

        int[] result = intervals[0];

        foreach (var interval in intervals)
        {
            if (interval[0] <= result[1])
            {
                result[0] = Math.Max(result[0], interval[0]);
                result[1] = Math.Min(result[1], interval[1]);
            }
            else
            {
                return null;
            }
        }

        return result;
    }
}
```

This C# code performs the same task as the Python code provided earlier. It finds the common intersection point among a list of intervals and outputs the result.
